pragma solidity ^0.4.18;

import './TrustedProxy.sol';
import './PublicProxy.sol';

/* The Relay library serves as a base library for any contract that wishes to expose methods through proxy addresses. */
library Relay {

    struct Data {
        // a mapping of methodId => proxy address
        mapping (bytes4 => mapping(address => address)) relays;
    }

    /** Adds a public relay for the given method. */
    function addPublicRelay(Data storage self, bytes4 methodId) public {
        if (methodId == 0x0) revert();
        self.relays[methodId][this] = address(new PublicProxy(methodId, this));
    }

    /** Adds a relay for the given method. */
    function addRelay(Data storage self, bytes4 methodId, address owner, address recipient, address token) public {
        if (methodId == 0x0) revert();
        self.relays[methodId][owner] = address(new TrustedProxy(methodId, this, owner, recipient, token));
    }

    /** Retrieves the dynamic contract address that can be sent a transaction to trigger the given method. */
    function getRelay(Data storage self, bytes4 methodId, address owner) public view returns (address) {
        return self.relays[methodId][owner];
    }
}
